import React, { useEffect, useRef } from 'react';
import '../styles/LexiBloomTitle.css';

function LexiBloomTitle() {
  return (
    <div className="lexi-container">
      <svg
        className="lexi-svg"
        viewBox="0 0 600 100"
        fill="none"
        xmlns="http://www.w3.org/2000/svg"
      >
        <text
          x="50%"
          y="50%"
          dominantBaseline="middle"
          textAnchor="middle"
          className="lexi-text"
        >
          LexiBloom
        </text>
      </svg>
    </div>
  );
}

export default LexiBloomTitle;
